CREATE DEFINER=`root`@`localhost` PROCEDURE `uspSelMessageCode`(IN `message_code_id` INT)
    READS SQL DATA
BEGIN
	SELECT
    	M.id,
		M.message AS 'message',
        M.message_type,
        CONCAT(M.message,';;',M.message_type) AS 'message;;type',
        M.created_date,
        M.created_by
    FROM
    	`message_codes` M
    WHERE
    	CASE WHEN message_code_id = 0
        THEN 0
        ELSE M.id	
        END = message_code_id;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `uspSelParameter`(IN `parameter_id` INT)
    READS SQL DATA
BEGIN
	SELECT
    	P.id,
        P.parameter_name,
        P.parameter_type,
        P.parameter_value,
        P.created_date,
        P.created_by,
        P.modified_date,
        P.modified_by
    FROM
    	`parameters` P
    WHERE
    	CASE WHEN parameter_id = 0
        THEN 0
        ELSE P.id
        END = parameter_id
	ORDER BY
		P.id;
    
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `uspSelPostByName`(IN `post_name` VARCHAR(200), IN `post_status` VARCHAR(25))
    READS SQL DATA
BEGIN
	SELECT
    	p.id,
        p.title,
        p.excerpt,
        p.content,
        p.status,
        p.post_type,
        p.post_name
    FROM
    	`posts` P
	WHERE
    	P.post_name = post_name
        AND CASE WHEN post_status = ''
        THEN post_status ELSE p.post_status END = post_status
    ;    
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `uspSelRole`(IN `role_id` INT)
BEGIN
	SELECT
		R.id,	
        R.role_name,
        R.description
	FROM
		`roles` R
	WHERE
    	CASE WHEN role_id = 0
        THEN 0
        ELSE R.id
        END = role_id
	ORDER BY
		R.id;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `uspSelUserLogin`(IN `user_name` VARCHAR(150), IN `user_password` VARCHAR(150))
    READS SQL DATA
BEGIN
	SELECT
    	U.id,
        U.user_name,
        U.full_name,
        U.email,
        U.phone,
        U.is_enabled
    FROM
    	`users` U
	WHERE
    	U.user_name = user_name
        AND U.user_password = user_password
    ;
END$$

