CREATE DEFINER=`root`@`localhost` FUNCTION `ufnCheckControllerAccess`(`user_id` INT, `class` VARCHAR(50), `method` VARCHAR(50)) RETURNS tinyint(1)
    NO SQL
IF(
	SELECT
	MAX(
        CASE 
            WHEN UR.role_id IS NULL AND C.is_secure = 0
            THEN 1
            WHEN UR.role_id IS NOT NULL AND C.is_secure = 1
            THEN 1
            WHEN UR.role_id IS NULL AND C.is_secure = 1
            THEN 0
            ELSE 0
        END) AS 'allow'
FROM 
	`controllers` C INNER JOIN `modules` M
    	ON(C.module_id = M.id)
	LEFT JOIN `roles_controllers` RC
    	ON(C.id = RC.controller_id)
	LEFT JOIN `roles` R
    	ON(R.id = RC.role_id)
	LEFT JOIN `user_roles` UR
    	ON(R.id = UR.role_id AND UR.user_id = user_id)
WHERE 
	LOWER(M.module_name) = class
    AND LOWER(C.controller_name) = method
)
THEN
	RETURN TRUE;
ELSE
	RETURN FALSE;
END IF$$

