INSERT INTO `posts` (`id`, `user_id`, `content`, `title`, `excerpt`, `status`, `post_name`, `post_type`, `created_date`, `created_by`, `modified_date`, `modified_by`) VALUES
(1, 1, '<!-- Intro Content -->\r\n        <div class="row">\r\n            <div class="col-lg-12">\r\n                <img class="img-fluid rounded float-left mt-2 mr-3" src="<?=site_url().''/assets/images/image1.jpg''?>" alt="">\r\n				<div class="p-2">\r\n					<h2>Sejarah Perpustakaan Universitas</h2>\r\n					<p class="text-justify">Keberadaan Perpustakaan Universitas UKSW (PU-UKSW) dimulai bersamaan dengan didirikannya Perguruan Tinggi Pendidikan Guru Kristen Indonesia (PTPGKI) pada tanggal 30 November 1956. Ketika itu PTPGKI menempati beberapa ruang di kompleks perkantoran Gereja Kristen Jawa Tengah (GKJT) yang berlokasi di Jalan Dr. Sumardi 5 Salatiga.</p>\r\n					<p class="text-justify">Perpustakaan pindah ke lokasi kampus Universitas Kristen Satya Wacana mulai tahun 1967 dan menempati Gedung Dr. Hayes Student Centre (sekarang Gedung Fakultas Bahasa &amp; Seni, progdi Seni Musik, di depan Gedung F).</p>\r\n					<p class="text-justify">Mulai tahun 1970, PU-UKSW menempati gedung perpustakaan berlantai dua dengan nama Perpustakaan Pusat. </p>	\r\n					<p class="text-justify">Pada tahun 1992 Gedung Perpustakaan Pusat direnovasi dan diberi nama Gedung Notohamidjojo. Mulai bulan Desember 1993, Perpustakaan menempati sebagian Lantai 1, Lantai 2, 3 dan sebagian Lantai 4 dari Gedung Notohamidjojo.</p>	\r\n					<p class="text-justify">Gedung ini dilengkapi dengan sebuah lambang berupa kaca patri menggambarkan 4 figur wanita terkenal dalam cerita pewayangan, yaitu:</p>	\r\n					<p class="text-justify">\r\n						 <ul class="list-unstyled">\r\n						  <li>Dewi Saraswati yang menggambarkan Pengetahuan</li>\r\n						  <li>Dewi Kamaratih yang menggambarkan Persahabatan</li>\r\n						  <li>Dewi Sri yang menggambarkan Pengertian</li>\r\n						  <li>Dewi Kunthi yang menggambarkan Kearifan</li>\r\n						</ul>\r\n					</p>\r\n					<p class="text-justify">Sejak tahun 1995 Perpustakaan menggunakan nama "Perpustakaan Universitas - UKSW" untuk menunjukkan bahwa pelayanan perpustakaan dikelola secara tersentral.</p>\r\n					<p class="text-justify">Setelah sempat beberapa tahun mengelola Pelayanan Cabang Pascasarjana dan Penelitian, dan Pelayanan Cabang Biblioterapi; namun dengan berkembangnya dan bertambahnya program studi maka Pelayanan Cabang Biblioterapi dilebur menjadi Laboratorium Konseling - Fakultas Psikologi. Sedangkan Pelayanan Cabang Pascasarjana dan Penelitian beralih fungsi sebagai Ruang Baca Pascasarjana dan dilayani di Gedung G 103 sejak Agustus 2007 sampai September 2012.</p>\r\n				</div>\r\n            </div>\r\n        </div>\r\n        <!-- /.row -->', 'Sejarah Perpustakaan Universitas', '<p class="text-justify">Keberadaan Perpustakaan Universitas UKSW (PU-UKSW) dimulai bersamaan dengan didirikannya Perguruan Tinggi Pendidikan Guru Kristen Indonesia (PTPGKI) pada tanggal 30 November 1956. Ketika itu PTPGKI menempati beberapa ruang di kompleks perkantoran Gereja Kristen Jawa Tengah (GKJT) yang berlokasi di Jalan Dr. Sumardi 5 Salatiga.</p>\r\n					<p class="text-justify">Perpustakaan pindah ke lokasi kampus Universitas Kristen Satya Wacana mulai tahun 1967 dan menempati Gedung Dr. Hayes Student Centre (sekarang Gedung Fakultas Bahasa &amp; Seni, progdi Seni Musik, di depan Gedung F).</p>', 'published', 'history', 'page', '2017-06-19 14:30:38', 'sysadmin', NULL, NULL);

